INSERT INTO `v1_0ef841ecfd569ae7bdb9e024125a3f9b272e0c051ac1dd34438a9c87c6fdb162` VALUES (5, 1, 1, 0, 111011, 0, 1110501049, 1110501, "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！", "", 11);
INSERT INTO `v1_0ef841ecfd569ae7bdb9e024125a3f9b272e0c051ac1dd34438a9c87c6fdb162` VALUES ("", "", "", "", 0, "", 1110501050, 1110501, "", "", 91);
